import React from 'react';

const calculatorSummary = (props) => {
    return (
        <div>
            <center><h1>Summary for the month {props.workedMonthName}</h1>
                <br></br>
                Time dimension on this date: {props.workedHoursInMonth}h, przepracowano: {props.workedHours}h<br></br>
                Stawka godzinowa (brutto): {props.hourlyFee}zł<br></br>
                Liczba nadgodzin: {props.overHoursAmount}, wynagrodzenie brutto: {props.overHoursGrossIncome}zł<br></br>
                Liczba nadgodzin: {props.overHoursAmount}, wynagrodzenie netto: {props.overHoursNetIncome}zł<br></br>
                Wynagrodzenie całkowite brutto (podstawa + nadgodziny): {props.totalGrossIncome}zł<br></br>
                Wynagrodzenie całkowite netto (podstawa + nadgodziny): {props.totalNetIncome}zł
            </center>
        </div>
    );
}

export default calculatorSummary;
